import React from 'react'
import useApi from '../../_hooks/useApi'
import { ILandingpageValues } from '../../_interfaces/ILandingpageValues'
import LandingPage from './LandingPage'
import apiConfig from '../../_config/apiConfig.json'

const LandingPageDataService: React.FC = () => {

    const valueDataService = useApi<ILandingpageValues>({serviceUri: apiConfig.baseUrl + apiConfig.i18nController + "landingpage_landingpageEn", params: null})
    
    if(valueDataService.items[0] === null){
        return null
    }
    
    return(
        <LandingPage values={valueDataService.items[0]}/>
    )
}

export default LandingPageDataService
